import React, { Component } from 'react';
import styles from "./css/accountOverview.module.css"
const AccountOverview = () => {
    return ( 
        <React.Fragment>
            <div className={styles.parent} >
                <h1>ACCOUNT OVERVIEW</h1>
            </div>
        </React.Fragment>
     );
}
 
export default AccountOverview;
